def sanitize_dict(dictionary):
  result = []
  for d in dictionary:
    r = dict(d)
    for key,value in d.items():
      new_key = key[6:]
      if new_key in Matter.required_keys():
        final_value = (None if value == "null" else value)
        final_key  = ("RecordId" if new_key == "Id" else new_key)
        r[final_key] = final_value
      del r[key]
    result.append(r)
  return result


def pushToDb(dict):
  updated_dict = sanitize_dict(dict)
  print(sanitize_dict(matterListDict))
  Matter.create_with_dict(updated_dict, 1)

def messageBox(city, cat):
  if cat.get():
    messagebox.showinfo(title="City", message="City: " + str(city.get()) + "\nCategory: " + str(cat.get()))
    Label(frame, text="   ", font="Symbol 11").grid(row=5)
    # cityMatters = Matter(matterListDict)
    # result = cityMatters.calculate(0)
    result = "Temporary Empty"
    print(result)
    Label(frame, text=result, font="Symbol 11").grid(row=6, column=0, columnspan=6, sticky=W+E)
  else:
    messagebox.showinfo(title="Error", message="No category selected!")

